  false,\n\t\"url\": null,\n\t\"notes\": \"nThis feature class is part of the Cadastral
  National Spatial Data Infrastructure (NSDI) CADNSDI publication data set for rectangular
  and non-rectangular Public Land Survey System (PLSS) data set.  The metadata description
  in the Cadastral Reference System Feature Data Set more fully describes the entire
  data set.nThis is a graphic representation of the data stewards for the Public Land
  Survey System (PLSS). For BLM data sets the the data steward is identifed at the
  township level or smaller area  The Data Steward is agency that will be responsible
  for updates of the PLSS. In the shared environment of the Natioanl Spatial Data
  Infrastructure (NSDI) the data steward for an area is the primary coordinator or
  agency responsible for making updates or causing updates to be made. Any questions
  about data content should be directed to the data steward.n\",\n\t\"license_title\":
